import { Fragment } from "react";
import styled from "styled-components";
import { useForm } from "react-hook-form";

export const SignupPage = (props) => {
  const { register, handleSubmit } = useForm();
  return (
    <Form
      onSubmit={handleSubmit((data) => {
        console.log(data);
      })}
    >
      <NameInput
        id="name"
        type="text"
        {...props.register("id", {
          require: "이름을 입력해주세요",
        })}
      />
      <EmailInput />
      <AgeInput />
      <PasswordInput />
      <PWConfirmInput />
      <button>제출하기</button>
    </Form>
  );
};

const Form = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 80px 0;
  gap: 45px;

  NameInput,
  EmailInput,
  AgeInput,
  PasswordInput,
  PWConfirmInput {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    gap: 20px;
  }

  .movePage {
    display: flex;
    gap: 30px;
  }

  input {
    width: 600px;
    height: 40px;
  }

  button {
    width: 620px;
    height: 60px;
    font-weight: bold;
    font-size: 15px;
  }

  input,
  button {
    border-radius: 35px;
    padding-left: 15px;
  }
`;
